const gridExamplesPage = () => {
    return (
        <MDBContainer>

              {/** Wishes Dropdown Button */}
            <MDBCol style={{ paddingLeft: 0, paddingRight: "10px" }}>
            <div class="btn-group">
  <button type="button" class="btn dropcolor">Soovitused / Eesm√§rgid</button>
  <button
    type="button"
